column8:
●モイストセイバーパッチ成分配合。うるおい成分を徐々に肌へ届けます。紫外線や乾燥などで刺激を受けやすい目もとのうるおいを長時間キープし、肌荒れを防ぎます。<br>
●敏感な目もとに対し、摩擦を与えずに肌にのせている感覚が適度にある使用感にこだわりました。<br>
●アイシャドウなどの“のり”や“持ち”をアップし、ヨレにくい肌に整えます。アイメイクの仕上がりに明るい印象を与えます。<br>
●無香料・無着色・鉱物油無添加・界面活性剤無添加・ノンアルコール（エチルアルコール無添加）・ノンパラベン<br>
●パッチテスト・アレルギーテスト・コメドテスト済み。［すべての方に刺激・アレルギー・コメド（ニキビのもと）が生じないというわけではありません］ <br><br>

【使用方法】<br>
● ジェル、クリームを塗った後、米粒１つ分位を手にとり、指先で両方の目もと全体（上まぶた、下まぶた）にやさしくなじませてください。<br>
● お休み前や、特に乾燥が気になるときは、少し多めにご使用ください。<br>
● まぶたの乾燥が気になる時は、適量を手にとり、指先でこすらず押さえるようになじませます。アイクリームが乾いたのを確認してから、アイメイクを直してください。<br>
● 目に入らないようにご注意ください。万一、目に入ったときは、直ちに洗い流してください。<br><br>

【ご注意】<br>
○傷やはれもの、しっしん等異常のある部位には、お使いにならないでください。<br>
○本品がお肌に合わないときは、ご使用をおやめください。そのまま使用を続きますと、症状を悪化させることがありますので、皮ふ科専門医等にご相談されることをおすすめします。<br>
1.使用中、赤味、はれ、かゆみ、刺激等の異常があらわれた場合。<br>
2.使用したお肌に、日光があたって上記のような異常があらわれた場合。<br>
○目に入らないようにご注意ください。万一、目に入ったときは、直ちに水またはぬるま湯で洗い流してください。<br>
○お肌が特にかぶれやすい方は、腕の内側などの柔らかいところに少量つけて、かゆみ、赤味などの異常がないことを確かめてからご使用ください。<br>
○使用後は容器の口を清潔に保ち、キャップをしめて保管してください。<br>
○乳幼児の手の届かないところに保管してください。<br>
○直射日光のあたる場所、極端に高温または低温の場所には保管しないでください。<br>○使用期限（未開封時）を過ぎた製品は、使用しないでください。<br><br>

【成分】<br>
水、スクワラン、グリセリン、BG、ベヘニルアルコール、ペンチレングリコール、ミツロウ、ラウロイルグルタミン酸ジ（フィトステリル/オクチルドデシル）、ホホバ種子油、バチルアルコール、アテロコラーゲン、アミノカプロン酸、グリシン、グリチルレチン酸ステアリル、セリン、セレブロシド、トコフェロール、ヒアルロン酸Na、ヒドロキシプロリン、プロリン、アルカリゲネス産生多糖体、アルギニン、アルギン酸Na、エチルヘキシルグリセリン、キサンタンガム、クエン酸Na、ラウロイルグルタミン酸ジ（オクチルドデシル/フィトステリル/ベヘニル）<br><br>

【内容量】<br>
15g<br><br>

【販売元】<br>
全薬販売株式会社<br>
東京都豊島区東池袋3-22-14<br>
お客様相談室：03-3946-1126<br><br>

【商品区分】<br>
化粧品<br><br>

［Arouge/アルージェTE/アルージェ アイゾーン クリーム］

